import React from 'react';
import { WithWizard } from 'react-albus';

const Navigation = () => (
  <WithWizard
    render={({ next, previous, step, steps }) => (
      <div className="example-buttons">
      {steps.indexOf(step) > 0 && (
        <button className="button btn-fluid btn-secondary" onClick={previous} type="button">
          Back
        </button>
      )}
        {steps.indexOf(step) < steps.length - 1 && (
          <button className="button btn-fluid margin-1-b" onClick={next} type="button">
            Next
          </button>
        )}


        {steps.indexOf(step) === steps.length - 1 && (
          <button className="button btn-fluid margin-1-b" onClick={previous} type="button">
            Submit
          </button>
        )}
      </div>
    )}
  />
);

export default Navigation;
